package com.zhianjia.m.zhianjia.haier.net.data;import java.io.Serializable;import java.util.Map;/** * @author henzil * @E-mail lizhen@dns.com.cn * @version create time:2013-7-22_下午1:59:20 * @Description 所有model 基类。 */public  class BaseModel implements Serializable {	/**	 * 	 */	private static final long serialVersionUID = 5268625605268545266L;	private int code;	private int result;	private String msg;    private String message;    public boolean isCache;    public String cacheKey;	private int status;	private String retCode;	private String retInfo;	private Map<String, String> headers;	public Map<String, String> getHeaders() {		return headers;	}	public void setHeaders(Map<String, String> headers) {		this.headers = headers;	}	public String getRetCode() {		return retCode;	}	public void setRetCode(String retCode) {		this.retCode = retCode;	}	public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }	public int getResult() {		return result;	}	public void setResult(int result) {		this.result = result;	}	public static long getSerialversionuid() {		return serialVersionUID;	}	public int getCode() {		return code;	}	public void setCode(int code) {		this.code = code;	}	public String getMsg() {		return msg;	}	public void setMsg(String msg) {		this.msg = msg;	}	public int getStatus() {		return status;	}	public void setStatus(int status) {		this.status = status;	}	public String getRetInfo() {		return retInfo;	}	public void setRetInfo(String retInfo) {		this.retInfo = retInfo;	}}